  title: 'Add Block',
  // \u5305\u88C5\uFF0C\u4F8B\u5982\u63D2\u5165\u5230 Grid \u91CC\uFF0C\u9700\u8981\u7528 Grid.wrap \u5904\u7406\uFF08\u6DFB\u52A0\u884C\u5217\u6807\u7B7E\uFF09
  wrap: Grid.wrap,
  // \u63D2\u5165\u4F4D\u7F6E\uFF0C\u9ED8\u8BA4\u4E3A beforeEnd\uFF0C\u652F\u6301 'beforeBegin' | 'afterBegin' | 'beforeEnd' | 'afterEnd'
