// \u6BCF\u4E2A\u63D2\u4EF6\u7684 app \u6700\u5C0F\u5316\u5B89\u88C5\u7684\u63D2\u4EF6\u90FD\u4E0D\u4E00\u6837\uFF0C\u9700\u8981\u63D2\u4EF6\u6839\u636E\u81EA\u5DF1\u7684\u60C5\u51B5\u6DFB\u52A0\u5FC5\u5907\u63D2\u4EF6
async function createApp(options: any = {}) {
  const app = mockServer({
    ...options,
    plugins: [
      'acl',
      'users',
      'collection-manager',
      'error-handler',
      ...options.plugins,
    ],
    // \u8FD8\u4F1A\u6709\u4E9B\u5176\u4ED6\u53C2\u6570\u914D\u7F6E
  });
  // \u8FD9\u91CC\u53EF\u4EE5\u8865\u5145\u4E00\u4E9B\u9700\u8981\u7279\u6B8A\u5904\u7406\u7684\u903B\u8F91\uFF0C\u6BD4\u5982\u5BFC\u5165\u6D4B\u8BD5\u9700\u8981\u7684\u6570\u636E\u8868
  return app;
}

// \u5927\u90E8\u5206\u7684\u6D4B\u8BD5\u90FD\u9700\u8981\u542F\u52A8\u5E94\u7528\uFF0C\u6240\u4EE5\u4E5F\u53EF\u4EE5\u63D0\u4F9B\u4E00\u4E2A\u901A\u7528\u7684\u542F\u52A8\u65B9\u6CD5
async function startApp() {
  const app = createApp();
  await app.quickstart({
    // \u8FD0\u884C\u6D4B\u8BD5\u524D\uFF0C\u6E05\u7A7A\u6570\u636E\u5E93
    clean: true,
  });
  return app;
}

describe('test example', () => {
  let app: MockServer;

  beforeEach(async () => {
    app = await startApp();
  });

  afterEach(async () => {
    // \u8FD0\u884C\u6D4B\u8BD5\u540E\uFF0C\u6E05\u7A7A\u6570\u636E\u5E93
    await app.destroy();
    // \u53EA\u505C\u6B62\u4E0D\u6E05\u7A7A\u6570\u636E\u5E93
    await app.stop();
  });

  test('case1', async () => {
    // coding...
  });
});
