`,paraId:29,tocIndex:9},{value:"Detailed Information",paraId:30,tocIndex:9},{value:"The ",paraId:31,tocIndex:9},{value:"can",paraId:31,tocIndex:9},{value:" method first checks if the role has the corresponding ",paraId:31,tocIndex:9},{value:"Action",paraId:31,tocIndex:9},{value:" permission registered; if not, it checks if the ",paraId:31,tocIndex:9},{value:"strategy",paraId:31,tocIndex:9},{value:" and the role matches. It means that the role has no permissions if it returns ",paraId:31,tocIndex:9},{value:"null",paraId:31,tocIndex:9},{value:"; else it returns the ",paraId:31,tocIndex:9},{value:"CanResult",paraId:31,tocIndex:9},{value:" object, which means that the role has permissions.",paraId:31,tocIndex:9},{value:"Example",paraId:32,tocIndex:9},{value:`// Define role and register permissions
